description:
Vittoria "raises the bar" for what concerns the standard casing quality level of modern
nylon race tyres. Up to now 120 TPI casings were considered as good performing, now the new
benchmark has been set to 150 TPI, that means lower rolling resistance and unrivaled
reliability. The Rubino is on a turf of his own when it comes to high mileage (torture tested in the
RAAM and other endurance races) and it has been completely renewed: new casing, new thread
pattern, new colours. - Nylon 150 TPI casing, market-standard for high performance;
- new Kevlar® Endura 3D Compound, with high duration and exciting road-behaviour;
- PRB puncture protection;
- updated tread pattern, with Prisma Vector Design
